import React from "react";

const AmazingNumberButton = (props) => {
	return (
		<div className="AmazingNumberButton">
			<button>1</button>
			<button>2</button>
			<button>3</button>
			<button>4</button>
			<button>5</button>
			<button>6</button>
			<button>7</button>
			<button>8</button>
			<button>9</button>
			<button>0</button>
			<button>C</button>
		</div>
	);
};

export default AmazingNumberButton;
